import React from 'react';
import './App.css';
import { Header } from './components/Header';

class App extends React.Component {
  constructor(props){
    super(props);
  }
  render () {
    return (
    <div className="App">
      <Header />
      <About />
      <Stack />
      <Projects />
      <Testimonials />
      <Contact />
    </div>
    );
  }
}

export default App;
